    $('.js-thumb_1').hover(function() {
      var a=$(this).data('image-large-src');
      var b="."+$(this).data('id');
      $(b+' .js-qv-product-cover_1').attr('src',a);
      $('.selected').removeClass('selected');
      $(event.target).addClass('selected');
      $(b+ '.js-qv-product-cover_1').prop('src', $(event.currentTarget).data('image-large-src'));
  });
});

$(document).ready(function(){
function vertical(a,b){
  var wrapper = $(a);
  var items = 3;
  if( $(window).width() < 420 ){
    items = 2;
  }
  else if( $(window).width() < 768 ){
    items = 3;
  }
  else if( $(window).width() < 992 ){
    items = 3;
  }
  else{
    items = items;
  }
  $(a).css('height', $(b).children((":first")).outerHeight()*items + 'px');
}
});
